import React, {Component} from 'react';
import "./css/index.scss"

class Conference extends Component {
    state
    render() {
        return (
            <div className="conference">
                <a href="/"><img src={require("./img/conference.jpg")} alt=""/></a>
            </div>
        );
    }
}

export default Conference;
